import React from "react";
import { useNavigate } from "react-router-dom";
import "../acc/AccPage.css";
import UsbIcon from '@mui/icons-material/Usb'; // Import the pendrive (USB) icon

const Card = ({ title, description, onClick, icon }) => (
  <div className="transparent-card">
    <div className="transparent-card-header">
      {icon && <span className="card-icon">{icon}</span>} {/* Display icon if provided */}
      {title}
    </div>
    <div className="transparent-card-content">
      {description}
    </div>
    <div className="transparent-card-footer">
      <button className="btn-primary" onClick={onClick}>More</button>
    </div>
  </div>
);

const DscPage = () => {
  const navigate = useNavigate();

  return (
    <div className="dsc-page">
      <header className="header">
        {/* Optional navigation */}
      </header>
      <main className="main">
        <section className="hero">
          <h1>Explore Our <span>DSC</span></h1>
          <div className="cards">
            <Card 
              title="DSC" 
              description="Professional will complete your DSC."
              icon={<UsbIcon />}
              onClick={() => navigate("/consulting-page")} 
            />
               <div className="cards">
            <Card 
              title="DSC" 
              description="Professional will complete your DSC."
              icon={<UsbIcon />} 
              onClick={() => navigate("/consulting-page")} 
            />
          </div>
          </div>
          <button className="go-back-btn" onClick={() => navigate("/")}> Go back</button>
        </section>
      </main>
    </div>
  );
}

export default DscPage;
